import { useDispatch, useSelector } from "react-redux";
import { setEmail, setName, setSurname } from "../slices/userSlice";
import { Link } from "react-router-dom";

function SigninPage (){

    const user= useSelector (state => state.user);
    const name = user.name;
    const surname =user.surname;
    const email =user.email;

    const dispatch = useDispatch();

    useEffect(() => {
      // Reset the values when the component mounts
      dispatch(setName(""));
      dispatch(setSurname(""));
    }, [dispatch]);
  
    return (
    <div>
        <div><h3>Sign In  Page</h3></div>

        <div class="inputArea">
            <div>
                <p class="text">Name:</p>
            </div>
            <div>
                <input class="input" value={name} onChange={e => dispatch(setName(e.target.value))}/>
            </div>
        </div>

        <div class="inputArea">
            <div>
                <p class="text">Surname:</p>
            </div>
            <div>
                <input class="input" value={surname} onChange={e => dispatch(setSurname(e.target.value))}/>
            </div>
        
        </div>

        <div class="inputArea">
            <div>
                <p class="text">E-Mail:</p>
            </div>
            <div>
                <input class="input" value={email} onChange={e => dispatch(setEmail(e.target.value))}/>
            </div>
        </div>

        <div class="buttonAreaLogin">
            <Link to="/home"><button class="loginButton">Login</button></Link>  
        </div>
  

    </div>
);
}

export default SigninPage;
